import React, { Component } from 'react';

class MainContent extends Component {



    constructor(props:{}){
        super(props);
        this.state = {
            count: 0
        }
    }


    render() {
        return (
            <div>
                <h1>MainContent Component</h1>
                <h2>Count : {this.state.count}</h2>
            </div>
        );
    }
}

export default MainContent;
